import styled from 'styled-components';

export const Container = styled.div`
 position:relative ;
 display: inline-block;
 margin:30px;
 width:350px;
 height: 400px;
 border-radius: 10px;
 background-color: #333;

 img{
     position: relative;
     bottom:50px
     width:350px;
     border-radius:19px;
 }
`;
